import Vue from "vue"
import VueRouter from "vue-router"
import Hello from "../components/HelloWord.vue"

Vue.use(VueRouter);

const routes = [
    {
        path:"/",
        name:"Home",
        component:Hello
    }
]

const router = new VueRouter({
    mode: "history",
    base: "http://localhost:8080/",
    routes
})

export default router
